import React, { useEffect, useState } from 'react';
import { useLocation } from 'react-router-dom';
import axios from 'axios';

const Results: React.FC = () => {
  const location = useLocation();
  const params = new URLSearchParams(location.search); // Get query parameters
  const url = params.get('url');

  const [performanceData, setPerformanceData] = useState<any>(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');

  useEffect(() => {
    if (url) {
      const fetchPerformanceData = async () => {
        try {
          setLoading(true);
          const { data } = await axios.get(
            `https://www.googleapis.com/pagespeedonline/v5/runPagespeed?url=${url}&key=YOUR_GOOGLE_API_KEY`
          );
          setPerformanceData(data);
        } catch (err) {
          setError('Error fetching performance data.');
        } finally {
          setLoading(false);
        }
      };
      fetchPerformanceData();
    }
  }, [url]);

  if (loading) return <div>Loading...</div>;
  if (error) return <div>{error}</div>;

  return (
    <div className="p-8">
      <h1 className="text-xl font-bold">Performance Results for {url}</h1>
      {performanceData && (
        <div>
          <p>Performance Score: {performanceData.lighthouseResult.categories.performance.score * 100}</p>
          {/* Add more details from the performanceData object */}
        </div>
      )}
    </div>
  );
};

export default Results;
